import styled from 'styled-components';

function App() {
  return (
    <Container>
      <h1>Hello World</h1>
    </Container>
  );
}

const Container = styled.div`
  display: flex;
  flex-wrap: wrap;
  // justify-content: space-around;
  box-sizing: border-box;
  padding: 10px;
`

export default App;
